INSERT INTO `posts` (`id`, `categoria_id`, `usuario_id`, `titulo`, `capa`, `slug`, `texto`, `status`, `visitas`, `cadastrado_em`, `atualizado_em`, `ultima_visita_em`) VALUES
(1, 5, 1, 'O que é Twig?', 'o-que-e-twig.jpg', 'o-que-e-twig-30-30-30-30-30-30-30', 'Twig é uma engine de templates PHP baseado no modelo MVC, os criadores do Twig também são responsáveis pelo Symfony framework. O objetivo do Twig é otimizar o código-fonte tornando-o visualmente mais elegante, em outras palavras o Twig procura separar o código-fonte do HTML. Seguindo o modelo MVC para criar separações claras entre Model, Controller da View', 1, 12, '2023-05-26 15:53:23', '2023-06-07 12:12:20', '2023-06-30 19:53:32'),
(2, 5, 1, 'PDO (PHP Data Object)', 'pdo-php-data-object.jpg', 'pdo-php-data-object-30-30', 'O PDO (PHP Data Object) é uma extensão da linguagem PHP para acesso a banco de dados. Totalmente orientado a objetos ele possui diversos recursos importantes, além de suporte a diversos mecanismos de banco de dados.', 1, 5, '2023-05-26 15:53:59', '2023-06-07 11:57:02', '2023-06-07 12:19:43'),
(3, 6, 1, 'O que é o MYSQL?', 'o-que-e-o-mysql.png', 'o-que-e-o-mysql-30-30', 'MySQL é um sistema open-source de gerenciamento de base de dados relacional. Para sites WordPress, isso quer dizer que ele ajuda a armazenar todas suas publicações, usuários, informações de plugins, etc. Ele armazena essas informações em “tabelas” separadas e as conecta com “chaves”, daí o seu nome relacional.', 1, 4, '2023-05-26 15:54:21', '2023-06-07 11:56:43', '2023-06-07 12:19:58'),
(4, 5, 1, 'O que é o PHP?', 'o-que-e-o-php.png', 'o-que-e-o-php-30', 'PHP é uma linguagem de programação voltada originalmente para desenvolvimento de sites e aplicações web. Por ser de código aberto e de fácil aprendizado, é uma das mais populares do mundo.', 1, 1, '2023-05-26 15:54:41', '2023-06-07 11:56:16', '2023-06-06 22:15:19'),
(6, 7, 1, 'O que é um sistema MVC?', 'o-que-e-um-sistema-mvc.jpg', 'o-que-e-um-sistema-mvc-30', 'O padrão MVC pode ser utilizado em vários tipos de projetos como, por exemplo, desktop, web e mobile. A comunicação entre interfaces e regras de negócios é definida através de um controlador, e é a existência deste controlador que torna possível a separação entre as camadas.', 1, NULL, '2023-05-26 15:54:58', '2023-06-07 11:55:49', NULL),
(22, 5, 1, 'O que o PHP pode fazer?', 'o-que-o-php-pode-fazer.png', 'o-que-o-php-pode-fazer-30', 'O PHP é focado principalmente nos scripts do lado do servidor, portanto, você pode fazer qualquer coisa que outro programa CGI pode fazer, como coletar dados de formulários, gerar páginas com conteúdo dinâmico ou enviar e receber cookies.', 1, NULL, '2023-05-26 15:55:12', '2023-06-07 11:55:02', NULL),
(29, 8, 1, 'O que é o CodeIgniter?', 'o-que-e-o-codeigniter.jpg', 'o-que-e-o-codeigniter-30-30', 'O Codelgniter é um poderoso framework PHP dentre diversos outros já existentes. Criado para desenvolvedores que precisam de um conjunto de ferramentas simples para a criação de aplicativos web completos, o CodeIgniter é uma excelente alternativa para o desenvolvimento de projetos utilizando o PHP.', 1, 3, '2023-05-26 15:55:31', '2023-06-07 11:53:19', '2023-06-07 12:16:48');
